#[test]
fn test_affine_8_mat() {
    assert([0x0180, 0x0120, 0x0180, 0x0120, 0x0180, 0x0120, 0x0180, 0x0120] == affine_8_mat([8, 8, 8, 8, 8, 8, 8, 8]));
}

